import React from 'react';
import { Link } from 'react-router-dom';

import './NavBar.css';

function NavBar() {
  return (
    <div className="header">
      <ul>
        <li><Link to="/HomeLower">Home</Link></li>
     	</ul>
      <hr />
    </div>
  );
};
export default NavBar;
